    changeInput(event) {
        let target = event.target
        let index = target.name
        this.setState({
            [index]: target.value
        })
        console.log(target.value)
    }

    formataData(event) {

        let target = event.target
        let index = target.name

        var data = target.value;
        if (event.onKeyPress != 8 && event.onKeyPress != 46) {
            if (data.length == 2) {
                target.value = data += '/';
            } else if (data.length == 5) {
                target.value = data += '/';
            } else
                target.value = data;
        }

        this.setState({
            [index]: target.value
        })
        console.log(target.value)
    }

